  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Erie National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1962.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, and
  raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and wildfires. Resource management is outlined;
  topics include grazing and haying. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, and safety. Items
  of interest, N-R forms, photographs, and newspaper articles are attached.\",\n\t\"owner_org\":
